//=========== skymill cities ==========
DROP TABLE IF EXISTS cities;
CREATE TABLE cities (
	 id INT NOT NULL
	,state VARCHAR NOT NULL
	,city VARCHAR NOT NULL
	,population INT NOT NULL
	,airport VARCHAR NOT NULL
	,airport_iata VARCHAR NOT NULL

);
//=========== skymill segments ==========
DROP TABLE IF EXISTS segments;
CREATE TABLE segments (
	 id INT NOT NULL
	,origin INT NOT NULL
	,destination INT NOT NULL
	,distance INT NOT NULL

);
//=========== skymill aircraft_types ==========
DROP TABLE IF EXISTS aircraft_types;
CREATE TABLE aircraft_types (
	 id INT NOT NULL
	,name VARCHAR NOT NULL
	,description VARCHAR NOT NULL

);
//=========== skymill aircraft ==========
DROP TABLE IF EXISTS aircraft;
CREATE TABLE aircraft (
	 id INT NOT NULL
	,aircraft_code VARCHAR NOT NULL
	,aircraft_type_id INT NOT NULL
	,capacity INT NOT NULL

);
//=========== skymill passenger ==========
DROP TABLE IF EXISTS passenger;
CREATE TABLE passenger (
	 id INT NOT NULL
	,first_name VARCHAR NOT NULL
	,last_name VARCHAR NOT NULL
	,domicile_address VARCHAR NOT NULL
	,domicile_city_id INT NOT NULL
	,age INT NOT NULL
	,loyalty_program_member BOOLEAN NOT NULL
	,loyalty_tier VARCHAR NOT NULL

);
