//=========== skymill flight_instances ==========
DROP TABLE IF EXISTS flight_instances;
CREATE TABLE flight_instances (
	 id INT NOT NULL
	,aircraft_id INT NOT NULL
	,segment_id INT NOT NULL
	,departure_date VARCHAR NOT NULL
	,arrival_date VARCHAR NOT NULL

);
//=========== skymill cargo_flights ==========
DROP TABLE IF EXISTS cargo_flights;
CREATE TABLE cargo_flights (
	 id INT NOT NULL
	,aircraft_id INT NOT NULL
	,segment_id INT NOT NULL
	,departure_date VARCHAR NOT NULL
	,arrival_date VARCHAR NOT NULL

);
//=========== skymill bookings ==========
DROP TABLE IF EXISTS bookings;
CREATE TABLE bookings (
	 id INT NOT NULL
	,passenger_id INT NOT NULL
	,flight_instance_id INT NOT NULL
	,seat_number VARCHAR NOT NULL

);
//=========== skymill loyalty_earnings ==========
DROP TABLE IF EXISTS loyalty_earnings;
CREATE TABLE loyalty_earnings (
	 id INT NOT NULL
	,booking_id INT NOT NULL
	,passenger_id INT NOT NULL
	,miles_earned INT NOT NULL
	,earning_date VARCHAR NOT NULL

);
//=========== skymill delays ==========
DROP TABLE IF EXISTS delays;
CREATE TABLE delays (
	 id INT NOT NULL
	,flight_instance_id INT NOT NULL
	,delay_minutes INT NOT NULL
	,reason VARCHAR NOT NULL

);
//=========== skymill cancellations ==========
DROP TABLE IF EXISTS cancellations;
CREATE TABLE cancellations (
	 id INT NOT NULL
	,flight_instance_id INT NOT NULL
	,cancellation_reason VARCHAR NOT NULL
	,cancellation_time VARCHAR NOT NULL

);
//=========== skymill ticket_prices ==========
DROP TABLE IF EXISTS ticket_prices;
CREATE TABLE ticket_prices (
	 booking_id INT NOT NULL
	,base_price DECIMAL(15,4) NOT NULL
	,taxes DECIMAL(15,4) NOT NULL
	,total_price DECIMAL(15,4) NOT NULL
	,travel_class VARCHAR NOT NULL
	,currency VARCHAR NOT NULL

);
//=========== skymill ratings ==========
DROP TABLE IF EXISTS ratings;
CREATE TABLE ratings (
	 id INT NOT NULL
	,passenger_id INT NOT NULL
	,flight_instance_id INT NOT NULL
	,rating INT NOT NULL
	,rating_comment VARCHAR NOT NULL
	,rated_at VARCHAR NOT NULL

);
