CREATE TABLE cargo_shipments (
	 id INT NOT NULL
	,cargo_flight_id INT NOT NULL
	,cargo_type_id INT NOT NULL
	,weight_kg INT NOT NULL
	,client_id INT NOT NULL
	,revenue DECIMAL(15,4) NOT NULL

);
